import React, { useEffect, useState } from 'react'
import axiosInstance from '../baseurl';
import { useParams } from 'react-router-dom';

function ViewGymByID() {
  const {id}=useParams()
  const [profile, setprofile] = useState({ img: [{ originalname: "" }] });

  useEffect(() => {
    axiosInstance
      .post(`/viewGymById/${id}`)
      .then((res) => {
        console.log(res, "result");
        setprofile(res.data.data);
      })
      .catch((err) => {
        console.log(err, "error");
      });
  }, []);
    const bookGym = (id)=>{
        axiosInstance.post(`/bookGym`, {
          cid:localStorage.getItem(`CustomerLogId`),
          gymid:id,
          message:prompt('Send a message')
          
        })
        .then((res)=>{console.log(res)
          
        })
        .catch((err)=>{console.log(err);})
      }
  return (
    <div className="productdiv1 container-top" style={{ minHeight: "700px" }}>
    <div >
      <h2 style={{ textAlign: "center" }}>
        {" "}
        Hi {profile.name}. Welcome to your profile. <br /> What would you like
        to do?
      </h2>
      <div class="card card-body">
        <div className="container">
          <div className="row">
            <div className="col-12">
              <div class="card">
                <div class="card-body" style={{ textAlign: "center" }}>
                  <h5 class="card-title">Name : {profile.name}</h5>
                  <p class="card-text">Email : {profile.email} </p>
                  <p class="card-text">Contact : {profile.contact} </p>

                  <div className="container">
                    <div className="row">
                      <div className="col">
                        <br />
                        <br />
                        <button
                          class="btn btn-primary"
                          style={{ margin: "0px 20px" }}
                          onClick={deletefn}
                        >
                          Delete Profile
                        </button>
                      </div>
                      <div className="col">
                        <form onSubmit={handleImageUpload}>
                          <div class="mb-3">
                            <label for="formFile" class="form-label">
                              Upload Gym pictures
                            </label>
                            <input
                              class="form-control"
                              type="file"
                              id="formFile"
                              multiple
                              onChange={changeimg}
                            />
                          </div>
                          <button className="btn btn-primary">Submit</button>
                        </form>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            </div>
            <div className="col-12">
              <div className="container">
                <div className="row">
                  <hr/>
                  {profile.img.map((a) => {
                    if (a.filename != undefined) {
                      console.log(a.filename);
                      return (
                        <div className="col-3">
                          <div>
                            <img
                              src={`http://localhost:4002/${a.originalname}`}
                              height={400}
                            />
                          </div>
                        </div>
                      );
                    }
                  })}
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
      <br />
      <p style={{ textAlign: "center" }}>
        <button
          class="btn btn-primary"
          style={{ margin: "0px 20px" }}
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#multiCollapseExample1"
          aria-expanded="false"
          aria-controls="multiCollapseExample2"
        >
          Edit Profile
        </button>
      </p>
    </div>
   
  </div>
  )
}

export default ViewGymByID
